imgui.OnFrame(function() return canShowMainWindow() end,
function()
    -- imgui.ShowDemoWindow()
    -- imgui.ShowStyleEditor()
    local sizeX, sizeY = getScreenResolution()
    imgui.SetNextWindowPos(ImVec2(sizeX / 2, sizeY / 2), imgui.Cond.FirstUseEver, ImVec2(0.5, 0.5))
    imgui.SetNextWindowSize(ImVec2(605, 353), imgui.Cond.FirstUseEver)
    if imgui.BeginPaper(script.this.name, nil, (isBuilding() and imgui.WindowFlags.NoMove or 0)) then
        local windowsize = imgui.GetWindowSize()
        local drawlist = imgui.GetWindowDrawList()
        local cursorPos = imgui.GetCursorScreenPos()

        imgui.SetCursorPos(ImVec2(0, 2))

        local cellAt
        do
            local startCellPosition = imgui.GetCursorScreenPos()
            cellAt = function(x, y)
                return ImVec2(startCellPosition.x + ((x - 1) * CELL_SIZE.x), startCellPosition.y + ((y - 1) * CELL_SIZE.y))
            end
        end

        imgui.SetCursorScreenPos(cellAt(24, 1))
        if imgui.Button("X", CELL_SIZE) then
            showMainWindow = false
        end

        if currentGamestate == GAMESTATE.INITIAL then
            imgui.SetCursorScreenPos(cellAt(1, 1))
            imgui.CenterText(script.this.name:upper(), true)

            if not isInRoom() then
                imgui.SetCursorScreenPos(cellAt(1, 4))
                imgui.CenterText("ВАШ НИК", true)

                imgui.SetCursorScreenPos(cellAt(1, 5))
                imgui.SetCursorPosX(imgui.GetWindowSize().x / 2 - (CELL_SIZE.x * 6) / 2)
                -- imgui.InputText('##myNickname', nickname, CELL_SIZE.x * 6, imgui.InputTextFlags.CallbackCharFilter + (tcpConnection ~= nil and imgui.InputTextFlags.ReadOnly or 0), nicknameEditCallback)
                imgui.InputText('##myNickname', myNicknameField, CELL_SIZE.x * 6)

                imgui.SetCursorScreenPos(cellAt(4, 8))
                if imgui.Button('СОЗД. КОМНАТУ', ImVec2(CELL_SIZE.x * 7, CELL_SIZE.x * 3)) then
                    createRoom()
                end

                imgui.SetCursorScreenPos(cellAt(4, 9))
                imgui.CenterText("ИЛИ", true)

                imgui.SetCursorScreenPos(cellAt(15, 8))
                imgui.InputTextWithHint('##roomUid', 'Ключ приглашения', roomUidField, CELL_SIZE.x * 7)

                imgui.SetCursorScreenPos(cellAt(15, 9))
                if imgui.Button('ПОДКЛ. К КОМН.', ImVec2(CELL_SIZE.x * 7, CELL_SIZE.x * 2)) then
                    joinToRoom()
                end
            else
                imgui.SetCursorScreenPos(cellAt(1, 6))
                imgui.CenterText("Ваша комната успешно создана!", true)
                imgui.SetCursorScreenPos(cellAt(1, 7))
                imgui.CenterText("Отправьте данный ключ приглашения вашему другу:", true)
                imgui.SetCursorScreenPos(cellAt(1, 8))
                imgui.SetCursorPosX(imgui.GetWindowSize().x / 2 - (CELL_SIZE.x * 14) / 2)
                imgui.CenterInputText('##roomUid', roomUidField, CELL_SIZE.x * 14)

                imgui.SetCursorScreenPos(cellAt(1, 10))
                imgui.SetCursorPosX(windowsize.x / 2 - (CELL_SIZE.x * 7) / 2 )
                if imgui.CenterButton('ОТКЛЮЧИТЬСЯ', ImVec2(CELL_SIZE.x * 7, CELL_SIZE.x * 2)) then
                    closeConnection()
                end
            end
        elseif currentGamestate == GAMESTATE.OVER then
            imgui.SetCursorScreenPos(cellAt(1, 6))
            imgui.CenterText("Игра окончена", true)
            if imgui.CenterButton('РЕВАНШ', ImVec2(CELL_SIZE.x * 7, CELL_SIZE.x * 2)) then
                requestRevenge()
            end
        else
            for i = 1, 2 do
                local isOwn = i == 1
                local playerType = isOwn and ME or ENEMY

                local battlefieldContainer = getBattlefieldContainer(playerType)

                local battlefieldCellX, battlefieldCellY = (isOwn and 1 or 13), 3
                local nicknamePosX, nicknamePosY = battlefieldCellX + 1, battlefieldCellY - 1

                local nicknameStartPos = cellAt(nicknamePosX, nicknamePosY)
                local battlefieldStartPos = cellAt(battlefieldCellX, battlefieldCellY)
                local battlefieldEndPos = battlefieldStartPos + CELL_SIZE * 11

                local cursorPos = battlefieldStartPos

                imgui.SetCursorScreenPos(nicknameStartPos)

                local nickname = getNickname(playerType)
                local nicknameSize = imgui.CalcTextSize(nickname)
                do
                    imgui.SetCursorPosY(imgui.GetCursorPos().y + (CELL_SIZE.y / 2 - nicknameSize.y / 2))
                    imgui.TextUnformatted(nickname)
                end

                local doesEntityHaveConflicts = function(entity)
                    for _, nestedEntity in ipairs(battlefieldContainer) do
                        if nestedEntity ~= entity and entity:collidesWith(nestedEntity) then
                            return true
                        end
                    end
                    return false
                end

                -- Battlefield conflicts check
                local doesBattlefieldHaveConflicts = function()
                    for _, entity in ipairs(battlefieldContainer) do
                        for _, nestedEntity in ipairs(battlefieldContainer) do
                            if nestedEntity ~= entity and entity:collidesWith(nestedEntity) then
                                return true
                            end
                        end
                    end
                    return false
                end

                if isBuilding() or whosTurn == playerType then
                    imgui.SetCursorScreenPos(nicknameStartPos + ImVec2(nicknameSize.x + 10, 0))
                    local text = isReady(playerType) and "ГОТОВ" or "НЕ ГОТОВ"
                    if not isBuilding() then
                        text = "ХОД"
                    end
                    local isButtonAvailable = isOwn and not isReady(playerType)
                    if not isButtonAvailable then
                        imgui.PushStyleColor(imgui.Col.ButtonHovered, ImVec4(0, 0, 0, 0))
                        imgui.PushStyleColor(imgui.Col.ButtonActive, ImVec4(0, 0, 0, 0))
                    end
                    if imgui.Button(text, ImVec2(CELL_SIZE.x * 4, CELL_SIZE.y)) and isButtonAvailable then
                        if getMaxPlaceableShipsCount() == #battlefieldContainer and not doesBattlefieldHaveConflicts() then
                            sendReadyToPlay()
                        end
                    end
                    if not isButtonAvailable then
                        imgui.PopStyleColor(2)
                    end
                end

                if not isOwn and not isPlaying() then break end
                -- The rest of scope related to the secondary player actions
                -- We don't need to attract with the secondary player battlefield if we're not in PLAYING state

                imgui.SetCursorScreenPos(cursorPos)
                renderBattlefield()
                imgui.PushClipRect(battlefieldStartPos + CELL_SIZE, battlefieldEndPos, true)
                for index, entity in ipairs(battlefieldContainer) do
                    entity:begin(cursorPos)
                    if isOwn and isBuilding() and not isReady(ME) then
                        if entity:clicked(0) then
                            replacingEntity = entity
                        end
                        if entity:clicked(1) then
                            entity:flip()
                        end
                        do
                            local hasConflicts = false
                            for _, nestedEntity in ipairs(battlefieldContainer) do
                                if nestedEntity ~= entity and entity:collidesWith(nestedEntity) then
                                    nestedEntity:begin(cursorPos)
                                    nestedEntity:renderBoundaries(CELL_BAD_COLOR)
                                    hasConflicts = true
                                end
                            end
                            if hasConflicts or entity == replacingEntity then
                                entity:renderBoundaries(hasConflicts and CELL_BAD_COLOR or CELL_OK_COLOR)
                            end
                        end
                    end
                    entity:render()
                end
                imgui.PopClipRect()

                local isMouseInBattlefield = imgui.IsMouseHoveringRect(battlefieldStartPos + CELL_SIZE, battlefieldEndPos, false)
                local findClosestPoint = function(entity) -- entity lets us to find the most sustainable position to fit into battlefield boundaries
                    local mousePos = imgui.GetMousePos()
        
                    local lastDist = 999999
                    local lastPos
                    local copyEntity
                    local size

                    if entity then
                        copyEntity = entity:copy()
                        size = copyEntity:size()
                    end

                    for x = 1, 10 do
                        for y = 1, 10 do
                            local pos = cellAt(battlefieldCellX + x, battlefieldCellY + y)
                            local dist = getDistanceBetweenCoords2d(pos.x, pos.y, mousePos.x, mousePos.y)
                            local dimensions
                            if copyEntity then
                                copyEntity.position = Vec2(x, y)
                                dimensions = copyEntity:dimensions()
                            end
                            if dist < lastDist then
                                if not dimensions
                                    or (dimensions.start.x >= 1 and dimensions.start.y >= 1 and dimensions.end_.x <= 10 and dimensions.end_.y <= 10)
                                then
                                    lastDist = dist
                                    lastPos = Vec2(x, y)
                                end
                            end
                        end
                    end

                    return lastPos
                end

                -- Replacing/rotating selected entity and placing new entities
                if isBuilding() then
                    if isOwn and replacingEntity then -- Replacing/rotating
                        if imgui.IsMouseDown(0) then
                            local closestPoint = findClosestPoint(replacingEntity)
                            if closestPoint then
                                replacingEntity.position = closestPoint
                            end
                        else
                            replacingEntity = nil
                        end
                    end

                    do -- List of placeable ships
                        local posY = battlefieldCellY + 2
                        for _, type_ in ipairs(PLACEABLE_ENTITIES) do
                            local posX = battlefieldCellX + 10 + 2
                            for i = 1, countAvailableShips(playerType, type_) do
                                local cursorPosEntity = cellAt(posX, posY)
                                local entity = createEntity(type_, {1, 1}, DIRECTION_TYPE.HORIZONTAL)
                                entity:begin(cursorPosEntity)
                                entity:render()

                                if entity:clicked(0) then
                                    local addedEntity = entity:copy()
                                    addedEntity.position.y = entity:size().y
                                    table.insert(battlefieldContainer, addedEntity)
                                end
                                posX = posX + entity:size().x + 1
                            end
                            posY = posY + 2
                        end
                    end
                end


                -- Shooting
                if not isOwn and isPlaying() and isMyTurn() and isMouseInBattlefield then
                    local closestPoint = findClosestPoint()
                    local pos = cellAt(battlefieldCellX + closestPoint.x, battlefieldCellY + closestPoint.y)
                    drawlist:AddRectFilled(pos, pos + CELL_SIZE, 0x55888888, 2)

                    if imgui.IsMouseClicked(0) then
                        sendShotAt(closestPoint.x, closestPoint.y)
                    end
                end
            end
        end
    end
    imgui.End()
end)

function renderBattlefield()
    local render = function(horizontal)
        local drawlist = imgui.GetWindowDrawList()
        local cursorPos = imgui.GetCursorScreenPos()
        local cursorPosBackup = ImVec2(cursorPos.x, cursorPos.y)
        local addPos = function()
            if horizontal then
                cursorPos.x = cursorPos.x + CELL_SIZE.x
            else
                cursorPos.y = cursorPos.y + CELL_SIZE.y
            end
        end
        addPos()
        for i = 1, 10 do
            local sym = tostring(string.char((horizontal and 48 or 64) + i))
            if horizontal and i == 10 then sym = '10' end
            local textSize = imgui.CalcTextSize(sym)
            imgui.SetCursorScreenPos(ImVec2(cursorPos.x + (CELL_SIZE.x / 2 - textSize.x / 2), cursorPos.y + (CELL_SIZE.y / 2 - textSize.y / 2)))
            imgui.TextUnformatted(sym)
            addPos()
        end
        imgui.SetCursorScreenPos(cursorPosBackup)

        local lineStart = cursorPosBackup + CELL_SIZE - ImVec2(1, 1)
        local lineEnd = lineStart + ImVec2((horizontal and (CELL_SIZE.x * 10) or 0) + 2, (not horizontal and (CELL_SIZE.y * 10) or 0) + 2)
        drawlist:AddRectFilled(lineStart, lineEnd, imgui.GetColorU32(imgui.Col.Text))
    end

    render(true)
    render(false)
end

function countAvailableShips(playerType, type_)
    local count = ENTITY_COUNT[type_]
    for _, entity in ipairs(getBattlefieldContainer(playerType)) do
        if entity.type == type_ then
            count = count - 1
        end
    end
    return count
end

function getMaxPlaceableShipsCount()
    local count = 0
    for _, type_ in ipairs(PLACEABLE_ENTITIES) do
        count = count + ENTITY_COUNT[type_]
    end
    return count
end

function isBuilding()
    -- if true then return true end
    return isInRoom() and currentGamestate == GAMESTATE.BUILDING
end

function isPlaying()
    return isInRoom() and currentGamestate == GAMESTATE.PLAYING
end

function isMyTurn()
    return whosTurn == ME
end

function getPlayerData(playerType)
    return playersData[playerType]
end

function isReady(playerType)
    return getPlayerData(playerType).ready
end

function getNickname(playerType)
    return getPlayerData(playerType).name
end

function getBattlefieldContainer(playerType)
    return getPlayerData(playerType).battlefield
end

function isInRoom()
    return tcpConnection ~= nil and myRole ~= PLAYERROLE_TYPE.NONE
end

function main()
    if not isSampfuncsLoaded() or not isSampLoaded() then return end
    while not isSampAvailable() do wait(50) end
    sampRegisterChatCommand("ssb", function() showMainWindow = not showMainWindow end)
    sampRegisterChatCommand("seabattle", function() showMainWindow = not showMainWindow end)
    addEventHandler("onWindowMessage", function(msg, wparam, lparam)
        if not canShowMainWindow() then
            return
        end

        if (msg == win.msg.WM_KEYDOWN or msg == win.msg.WM_SYSKEYDOWN) then
            if (wparam == vkeys.VK_ESCAPE and showMainWindow) then
                consumeWindowMessage(true, false)
                return
            end
        elseif (msg == win.msg.WM_KEYUP or msg == win.msg.WM_SYSKEYUP) then
            if (wparam == vkeys.VK_ESCAPE and showMainWindow) then
                showMainWindow = false
                return
            end
        end
    end)
    -- startConnection()
    while true do
        wait(300)
        pingServer()
    end
end

function canShowMainWindow()
    return showMainWindow and not (sampIsChatInputActive() or sampIsDialogActive() or (isSampfuncsConsoleActive and isSampfuncsConsoleActive()))
end

function createEntity(type_, position, direction)
    local obj = {
        type = type_,
        position = Vec2(position),
        direction = direction,
        bfStartPos = ImVec2(0, 0)
    }
    obj.copy = function(self) return createEntity(self.type, self.position, self.direction) end
    obj.flip = function(self)
        self.direction = self.direction == DIRECTION_TYPE.HORIZONTAL and DIRECTION_TYPE.VERTICAL or DIRECTION_TYPE.HORIZONTAL
        local dimensions = self:dimensions()
        if not (dimensions.start.x >= 1 and dimensions.start.y >= 1 and dimensions.end_.x <= 10 and dimensions.end_.y <= 10) then
            self.position.x = self:size().x
            self.position.y = self:size().y
        end
        return self
    end
    obj.size = function(self)
        local size_ = ENTITY_SIZE[self.type]
        return Vec2(
            self.direction == DIRECTION_TYPE.HORIZONTAL and size_.x or size_.y,
            self.direction == DIRECTION_TYPE.HORIZONTAL and size_.y or size_.x
        )
    end
    obj.dimensions = function(self)
        local size = self:size()
        return {
            start = Vec2(
                self.position.x,
                self.position.y - size.y + 1
            ),
            end_ = Vec2(
                self.position.x + size.x - 1,
                self.position.y
            )
        }
    end
    obj.begin = function(self, pos)
        self.bfStartPos = pos
        return self
    end

    local test = function(entity1, entity2)
        local dimensions1 = entity1:dimensions()
        local dimensions2 = entity2:dimensions()

        -- Ships must to have a spacing between each other for at least 1 cell
        dimensions1.start.x = dimensions1.start.x - 1
        dimensions1.start.y = dimensions1.start.y - 1
        dimensions1.end_.x = dimensions1.end_.x + 1
        dimensions1.end_.y = dimensions1.end_.y + 1

        return
            (
                dimensions1.start.x <= dimensions2.end_.x and
                dimensions1.end_.x >= dimensions2.start.x
            ) and
            (
                dimensions1.start.y <= dimensions2.end_.y and
                dimensions1.end_.y >= dimensions2.start.y
            )
    end
    obj.collidesWith = function(self, entity)
        return test(self, entity)
    end

    obj.render = function(self)
        local bfStartPos = self.bfStartPos
        local cellAt = function(x, y)
            return ImVec2(bfStartPos.x + (x * CELL_SIZE.x), bfStartPos.y + (y * CELL_SIZE.y))
        end

        local size = self:size()
        local dimensions = self:dimensions()

        local p2 = cellAt(dimensions.start.x, dimensions.start.y)
        local p1 = cellAt(dimensions.end_.x + 1, dimensions.start.y)
        local p3 = cellAt(dimensions.start.x, dimensions.end_.y + 1)
        local p4 = cellAt(dimensions.end_.x + 1, dimensions.end_.y + 1)

        if self.direction == DIRECTION_TYPE.VERTICAL then
            p1, p3 = p3, p1
        end

        if self.type == ENTITY_TYPE.EMPTY_CELL then
            imgui.GetWindowDrawList():AddRectFilled(
                cellAt(dimensions.start.x, dimensions.start.y),
                cellAt(dimensions.end_.x + 1, dimensions.end_.y + 1),
                0x55888888,
                2
            )
        else   
            imgui.GetWindowDrawList():AddImageQuad(entitiesImages[self.type], p1, p2, p3, p4)
        end
    end

    obj.renderBoundaries = function(self, color)
        if not color then color = 0x55888888 end
        local bfStartPos = self.bfStartPos
        local cellAt = function(x, y)
            return ImVec2(bfStartPos.x + (x * CELL_SIZE.x), bfStartPos.y + (y * CELL_SIZE.y))
        end

        local dimensions = self:dimensions()
        local p1 = cellAt(dimensions.start.x - 1, dimensions.start.y - 1)
        local p2 = cellAt(dimensions.end_.x + 2, dimensions.end_.y + 2)

        local divConst = ImVec2(CELL_SIZE.x / 2, CELL_SIZE.y / 2)
        imgui.GetWindowDrawList():AddRect(p1 + divConst, p2 - divConst, color, 2, 0, CELL_SIZE.x)
    end

    obj.clicked = function(self, button)
        local bfStartPos = self.bfStartPos
        local cellAt = function(x, y)
            return ImVec2(bfStartPos.x + (x * CELL_SIZE.x), bfStartPos.y + (y * CELL_SIZE.y))
        end

        local dimensions = self:dimensions()

        local p1 = cellAt(dimensions.start.x, dimensions.start.y)
        local p2 = cellAt(dimensions.end_.x + 1, dimensions.end_.y + 1)

        return imgui.IsMouseHoveringRect(p1, p2, false) and imgui.IsMouseClicked(button)
    end

    return obj
end

function Vec2(x, y)
    if type(x) == 'table' then
        y = x.y or x[2]
        x = x.x or x[1]
    end
    assert(type(x) == 'number' and type(y) == 'number')
    return {
        x = x,
        y = y
    }
end









-- Drawing functions
function imgui.CenterText(text, centerCell)
    local text = tostring(text)
    local textSize = imgui.CalcTextSize(text)
    imgui.SetCursorPosX(imgui.GetWindowSize().x / 2 - textSize.x / 2)
    if centerCell then
        imgui.SetCursorPosY(imgui.GetCursorPos().y + (CELL_SIZE.y / 2 - textSize.y / 2))
    end
    imgui.TextUnformatted(text)
end

function imgui.CenterButton(text, size)
    local text = tostring(text)
    imgui.SetCursorPosX(imgui.GetWindowSize().x / 2 - size.x / 2)
    return imgui.Button(text, size)
end

function imgui.CenterInputText(name, input, size, flags, callback)
    imgui.SetCursorPosX(imgui.GetWindowSize().x / 2 - size / 2)
    local res = imgui.InputText(name, input, size, flags, callback)
    return res
end

do
    local InputText = imgui.InputText

    function imgui.InputText(name, input, size, flags, callback)
        imgui.PushItemWidth(size or 0)
        local res = InputText(name, input, sizeof(input), (flags or 0), callback)
        imgui.PopItemWidth()
        return res
    end
end

do
    local InputTextWithHint = imgui.InputTextWithHint

    function imgui.InputTextWithHint(name, hint, input, size, flags, callback)
        imgui.PushItemWidth(size or 0)
        local res = InputTextWithHint(name, hint, input, sizeof(input), (flags or 0), callback)
        imgui.PopItemWidth()
        return res
    end
end

function imgui.BeginPaper(name, p_open, flags)
    local ret = imgui.Begin(name, p_open, bit.bor(flags, imgui.WindowFlags.NoDecoration))
    if ret then
        local windowsize = imgui.GetWindowSize()
        local drawlist = imgui.GetWindowDrawList()
        local cursorPos = imgui.GetCursorScreenPos()

        for x = 0 + CELL_SIZE.x, windowsize.x - CELL_SIZE.y, CELL_SIZE.x do
            drawlist:AddLine(ImVec2(cursorPos.x + x, cursorPos.y), ImVec2(cursorPos.x + x, cursorPos.y + windowsize.y), 0xffF4E4B9, 2)
        end

        for y = 0 + CELL_SIZE.y, windowsize.y - CELL_SIZE.y, CELL_SIZE.y do
            drawlist:AddLine(ImVec2(cursorPos.x, cursorPos.y + y), ImVec2(cursorPos.x + windowsize.x, cursorPos.y + y), 0xffF4E4B9, 2)
        end
    end
    return ret
end


-- Network
function startConnection()
    closeConnection()

    tcpConnection = assert(socket.tcp())
    tcpConnection:settimeout(10)
    local res, err = tcpConnection:connect(CONN_HOST, CONN_PORT)
    if res then
        tcpConnection:settimeout(0)

        lastServerPing = os.clock()
        lastServerPong = os.clock()
    else
        print("Could not connect to remote server", err)
        tcpConnection = nil
    end
    return res, err
end

function closeConnection(immediately, timeout)
    if not tcpConnection then return end

    if not immediately then
        sendEvent(EVENT_TYPE.DISCONNECT)
    end
    tcpConnection:close()
    tcpConnection = nil

    closedConnection(timeout)
end

function pingServer()
    if not tcpConnection then return end

    if isInRoom() then
        sendEvent(EVENT_TYPE.PING)
        local now = os.clock()
        if now - lastServerPing > 1.0 then -- AFK maybe?
            lastServerPong = now
        end
        lastServerPing = now
    end

    while true do
        if not tcpConnection then return end

        local s, status, partial = tcpConnection:receive("*l")
        local response = s
    
        local isTimeout = lastServerPing - lastServerPong >= 5
        if (not response and status ~= "timeout" and status ~= "wantread") or isTimeout then
            closeConnection(true, isTimeout)
            tcpConnection = nil
            return
        end

        if response and not response:empty() then
            response = decodeJson(response)
            assert(response ~= nil)
            incomingEvent(response.code, response.data)
        else 
            break
        end
    end

    -- socket.select(nil, nil, 0.1)
end

function sendEvent(eventId, data)
    assert(tcpConnection ~= nil)

    local data_ = {
        code = eventId,
        data = data
    }

    local dataStr = encodeJson(data_)
    assert(dataStr ~= nil and not dataStr:empty())
    tcpConnection:send(dataStr)
end

-- Callbacks
function closedConnection(timeout)
    if not timeout then
        addNotif("Сервер закрыл соединение.")
    else
        addNotif("Превышено время ожидания ответа от сервера.")
    end
    resetGameplayVariables()
end

function incomingEvent(eventId, data)
    if eventId == EVENT_TYPE.UNKNOWN_ERROR or eventId == EVENT_TYPE.SECURITY_ERROR then
        print("Error occured in server", data.error)
    elseif eventId == EVENT_TYPE.CREATE_ROOM then
        imgui.StrCopy(roomUidField, data.roomUid)

        ME = PLAYERROLE_TYPE.PRIMARY
        ENEMY = PLAYERROLE_TYPE.SECONDARY

        myRole = ME
    elseif eventId == EVENT_TYPE.JOIN_ROOM then
        getPlayerData(PLAYERROLE_TYPE.PRIMARY).name = data.primaryName
        getPlayerData(PLAYERROLE_TYPE.SECONDARY).name = data.secondaryName
        if myRole == PLAYERROLE_TYPE.NONE then
            ME = PLAYERROLE_TYPE.SECONDARY
            ENEMY = PLAYERROLE_TYPE.PRIMARY

            myRole = ME
        end
        
        if not canShowMainWindow() then
            addNotif("Добро пожаловать в игровую комнату!")
            addNotif(
                "Основной игрок: %s, второй игрок: %s",
                getNickname(PLAYERROLE_TYPE.PRIMARY),
                getNickname(PLAYERROLE_TYPE.SECONDARY)
            )
        end
    elseif eventId == EVENT_TYPE.SET_GAMESTATE then
        currentGamestate = data.gamestate

        whosTurn = PLAYERROLE_TYPE.NONE
        if currentGamestate == GAMESTATE.BUILDING then
            getPlayerData(PLAYERROLE_TYPE.PRIMARY).battlefield = {}
            getPlayerData(PLAYERROLE_TYPE.SECONDARY).battlefield = {}

            getPlayerData(PLAYERROLE_TYPE.PRIMARY).ready = false
            getPlayerData(PLAYERROLE_TYPE.SECONDARY).ready = false
        end

        if not canShowMainWindow() then
            if currentGamestate == GAMESTATE.BUILDING then
                addNotif("Комната готова приступить к процессу строения!")
            elseif currentGamestate == GAMESTATE.PLAYING then
                addNotif("Да начнётся битва!")
            elseif currentGamestate == GAMESTATE.OVER then
                addNotif("Игра окончена.")
            end
        end
    elseif eventId == EVENT_TYPE.CLEAR_BATTLEFIELD then
        local container = getBattlefieldContainer(data.role)
        local index = 1
        while true do -- dumbest thing ever i've done
            local entity = container[index]
            if entity then
                if  data.start.x <= entity.position.x and entity.position.x <= data.end_.x and
                    data.start.y <= entity.position.y and entity.position.y <= data.end_.y then
                    table.remove(container, index)
                    index = 1
                else
                    index = index + 1
                end
            else
                break
            end
        end
    elseif eventId == EVENT_TYPE.ADD_ENTITY then
        table.insert(getBattlefieldContainer(data.role), createEntity(
            data.entity.type,
            {data.entity.position.x, data.entity.position.y},
            data.entity.direction
        ))
    elseif eventId == EVENT_TYPE.READY_TO_PLAY then
        getPlayerData(data.role).ready = true

        if not canShowMainWindow() then
            addNotif("Игрок %s готов приступить к игре!", getNickname(data.role))
        end
    elseif eventId == EVENT_TYPE.SET_TURN then
        whosTurn = data.role

        if not canShowMainWindow() and whosTurn == ME then
            addNotif("Ваш ход.")
        end
    elseif eventId == EVENT_TYPE.PING then
        lastServerPong = os.clock()
    elseif eventId == EVENT_TYPE.PLAYER_WIN then
        local playerData = getPlayerData(data.role)
        playerData.winCount = playerData.winCount + 1
        
        -- if not canShowMainWindow() then
            addNotif("Игрок %s выиграл бой!", getNickname(data.role))
        -- end
    elseif eventId == EVENT_TYPE.REVENGE_REQUESTED then
        addNotif("Игрок %s запрашивает реванш.", getNickname(data.role))   
    elseif eventId == EVENT_TYPE.DISCONNECT then
        closeConnection()
    elseif eventId == EVENT_TYPE.ROOM_IS_FULL then
        addNotif("В указанной комнате недостаточно мест.")
    elseif eventId == EVENT_TYPE.INVALID_NICKNAME then
        addNotif("Некорректный никнейм. Пожалуйста, выберите другое имя.")
        addNotif("Например: Katsuro, Катсуро, ИлонМаск")
    elseif eventId == EVENT_TYPE.INVALID_ROOM_UID then
        addNotif("Некорректный код приглашения. Пожалуйста, убедитесь в корректности.")
    elseif eventId == EVENT_TYPE.INVALID_CLIENT_VERSION then
        addNotif("Сервер запретил вход, поскольку установленный вами скрипт не является актуальным.")
        addNotif("Пожалуйста, обновите %s.", script.this.name)
    elseif eventId == EVENT_TYPE.ROOM_CLOSED then
        addNotif("Комната закрыта.")
    elseif eventId == EVENT_TYPE.GAMEPLAY_TIMEOUT_EXCEEDED then
        addNotif("Превышено время игрового процесса комнаты.")
    elseif eventId == EVENT_TYPE.PLAYER_DISCONNECTED then
        addNotif("Игрок %s вышел из комнаты.", getNickname(data.role))
    end

    -- local eventName = eventId
    -- for name, id in pairs(EVENT_TYPE) do
    --     if eventId == id then
    --         eventName = name
    --         break
    --     end
    -- end

    -- if eventId ~= EVENT_TYPE.PING then
    --     sampAddChatMessage('event: ' .. eventName, -1)
    --     sampAddChatMessage('data: ' .. encodeJson(data), -1)
    -- end
end

-- Outgoing events
function createRoom()
    local res, err = startConnection()
    if not res then
        addNotif("Произошла неизвестная ошибка при попытке подключения к серверу.")
        addNotif("Убедитесь в наличии стабильного интернет-соединения.")
        return
    end

    sendEvent(EVENT_TYPE.CREATE_ROOM, {
        nickname = str(myNicknameField),
        version = script.this.version
    })
end

function joinToRoom()
    local res, err = startConnection()
    if not res then
        addNotif("Произошла неизвестная ошибка при попытке подключения к серверу.")
        addNotif("Убедитесь, что у вас имеется стабильное интернет-соединение.")
        return
    end

    sendEvent(EVENT_TYPE.JOIN_ROOM, {
        nickname = str(myNicknameField),
        roomUid = str(roomUidField),
        version = script.this.version
    })
end

function sendReadyToPlay()
    local entities = {}
    for _, entity in ipairs(getBattlefieldContainer(ME)) do
        table.insert(entities, {
            type = entity.type,
            position = {
                x = entity.position.x,
                y = entity.position.y
            },
            direction = entity.direction
        })
    end
    sendEvent(EVENT_TYPE.READY_TO_PLAY, {
        entities = entities
    })
end

function requestRevenge()
    sendEvent(EVENT_TYPE.REVENGE_REQUESTED)
end

function sendShotAt(x, y)
    sendEvent(EVENT_TYPE.SHOT_AT, {
        x = x,
        y = y
    })
end


-- Helpers
function addNotif(str, ...)
    str = string.format("%s » {ffffff}%s", script.this.name, str)
    str = str:format(...)
    str = cp(str)
    sampAddChatMessage(str, 0xFF8F6ADE)
end

function string.empty(str)
    return string.find(str, '%S') == nil
end

